import React from 'react';
import { Car } from '../types';

interface CarListProps {
    cars: Car[];
}

const CarList: React.FC<CarListProps> = ({ cars }) => {
    return (
        <div className="row">
            {cars.map((car) => (
                <div key={car.id} className="col-md-6 mb-4">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">{car.modelo.marca.nome} {car.modelo.nome}</h5>
                            <p className="card-text">
                                <strong>Ano:</strong> {car.ano} <br />
                                <strong>Pre√ßo:</strong> R$ {car.preco} <br />
                                <strong>Quilometragem:</strong> {car.quilometragem} km
                            </p>
                            <a href="#" className="btn btn-primary">Detalhes</a>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default CarList;
